import React from 'react';
import RoutedNav from './components/RoutedNav';
import Background from './components/Background';
import './App.css';

function App() {
  return (
    <div className = "background">
      <Background/>
      <div className = "routedNav">
      </div>
      <div className = 'mainModal'>
        <RoutedNav />
      </div>
    </div>
  )
}

export default App;
